import React, { useEffect } from 'react'
import { GoogleLogin } from 'react-google-login';
import { gapi } from 'gapi-script'








const Login = (props) => {



    const login = (res) => {
        console.log(res);
        props.response(res)
    }

    const loginFailed = (res) => {
        console.log(res);
        props.response()
    }


    useEffect(() => {
        gapi.load('client:auth2', () => {
            gapi.auth2.init({
                clientId: '421173557736-33lnq15lkplq291gvjhogma99h4ubb5d.apps.googleusercontent.com'
            })
        })



    }, [])

    return (
        <div>
            <GoogleLogin
                clientId={props.ci}
                render={renderProps => (
                    <button onClick={renderProps.onClick} disabled={renderProps.disabled} className="btn btn_login">
                        <span>
                            <svg version="1.2" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 2048 2048" width="2048" height="2048">
                                <title>Google__G__Logo</title>
                                <defs>
                                    <image width="2006" height="2048" id="img1" href="data:image/png;base64," />
                                </defs>
                                <style>
                                </style>
                                <use id="Background" href="#img1" x="21" y="0" />
                            </svg>
                        </span>
                        <span>Login</span>
                    </button>
                )}
                onSuccess={login}
                onFailure={loginFailed}
                isSignedIn={true}
                cookiePolicy={'single_host_origin'}
            />



        </div>
    )
}

export default Login